import {
    fetchDogs,
    fetchTemperaments,
    filterByTemperaments
} from "../redux/action/actions"
import React, { useEffect, useState } from "react";


const useAllDogs = (() => {
    const dispatch = useDispatch();
    dispatch(fetchDogs());
    dispatch(fetchTemperaments());
    dispatch(filterByTemperaments());
  }, [dispatch]);

export default useAllDogs
